import React from "react";
import {
  BrowserRouter,
  createBrowserRouter,
  Route,
  RouterProvider,
  Routes,
} from "react-router-dom";
import Hero from "./pages/HeroPage";

const router = createBrowserRouter([
  {
    path: "/",
    element: <Hero />,
  },
]);

/* function Router() {
